import React from 'react';



function App() {
    return (
        <>
        <div className='cards'>
            <div className = 'card'>
                <img src = 'images/vikings.jpg' alt = 'myPic' className='card__img' />
                <div className='card__info'>
                    <span className='card__category'> A Netflix Original Series </span>
                    <h3 className='card__title'> </h3>
                    <a href = 'https://www.netflix.com' target= '_blank' rel="noreferrer">
                        <button> Watch Now </button>
                    </a>
                </div>
            </div>
        </div>
        </>
    );
}



export default App;
